import "./App.css";

function App() {
  return (
    <>
      <div className="container text-center mt-5">
        <h1>Gallery</h1>
        <div className="row">
          {Array.apply(null, { length: 9 }).map(() => {
            return (
              <div className="col mb-5">
                <div class="card" style={{ width: "18rem" }}>
                  <img
                    src="https://media.diariouno.com.ar/p/78da26176812d47341b4614ee85ef68a/adjuntos/298/imagenes/009/226/0009226392/1200x0/smart/pityjpg.jpg"
                    class="card-img-top"
                    alt="placeholder"
                  />
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </>
  );
}

export default App;
